import React from 'react';
import Header from './components/Header';
import TaskBar from './components/TaskBar';
import taskList from './components/taskList';

class App extends React.Component{
    render(){
        return(
            <div>
                <Header />
                <taskBar />
                <taskList />
            </div>
        );
    };
};

export default App;
